public class RORVenueTableLookup extends FormRun
{
    smmBusRelAccount        busRelAccount;

    QueryBuildDataSource    qbdsVenueTableActive;
    QueryBuildDataSource    qbdsVenueTableBusinessRelation;
    QueryBuildDataSource    qbdsVenueTableAll;

    RORReturnNoteTableForm  returnNoteTableForm;

    FormDataSource          activeFormDataSource;

    FormStringControl       selectedControl;
    FormStringControl       callerControl;
    FormDataSource          selectedFormDataSource;
    Map                     tab2ComboBoxItemMap;

    #define.Active  (0)
    #define.BusRel  (1)
    #define.All     (2)

}

private void getBusRelAccount()
{
    PurchTable          purchTable;
    SalesLine           salesLine;
    SalesTable          salesTable;
    SalesQuotationTable salesQuotationTable;
    smmBusRelTable      smmBusRelTable;
    CustTable           custTable;
    InventJournalTable  inventJournalTable;

    if (returnNoteTableForm && returnNoteTableForm.parmCustAccount())
    {
        select firstonly BusRelAccount from smmBusRelTable
            exists join custTable
            where custTable.Party   == smmBusRelTable.Party
            && custTable.AccountNum == returnNoteTableForm.parmCustAccount();

        busRelAccount = smmBusRelTable.BusRelAccount;
    }
    else
    {
        switch (element.args().dataset())
        {
            case tableNum(PurchTable):
                purchTable = element.args().record();
                busRelAccount = smmBusRelTable::findByParty(purchTable.party()).BusRelAccount;
                break;

            case tableNum(SalesLine):
                salesLine = element.args().record();
                busRelAccount = smmBusRelTable::findByParty(salesLine.salesTable().partyTable_CustAccount().RecId).BusRelAccount;
                break;

            case tableNum(SalesTable):
                salesTable = element.args().record();
                busRelAccount = smmBusRelTable::findByParty(salesTable.partyTable_CustAccount().RecId).BusRelAccount;
                break;

            case tableNum(SalesQuotationTable):
                salesQuotationTable = element.args().record();
                busRelAccount = smmBusRelTable::findByParty(salesQuotationTable.party()).BusRelAccount;
                break;

            case tableNum(InventJournalTable):
                inventJournalTable = element.args().record();
                custTable = element.getCusttableFromInventJournalTable(inventJournalTable);

                if (custTable)
                {
                    busRelAccount = smmBusRelTable::findByParty(custTable.Party).BusRelAccount;
                }
                break;
        }
    }
}

public CustTable getCusttableFromInventJournalTable(InventJournalTable _inventJournalTable)
{
    CustTable custTable;
    return custTable;
}

[SuppressBPWarningAttribute("BPCheckInvalidInitFormMethodWarning", "Validation of caller must be performed before invoking super()")]
public void init()
{
    if (element.args() && element.args().caller() && classIdGet(element.args().caller()) == classNum(RORReturnNoteTableForm))
    {
        returnNoteTableForm = element.args().caller();
    }

    this.getBusRelAccount();

    super();

    if (!busRelAccount)
    {
        tabPageBusinessRelation.visible(false);
    }
}

public void run()
{
    boolean filterLookup = false;
    callerControl = SysTableLookup::getCallerStringControl(element.args());

    this.setSelectMode();

    filterLookup = SysTableLookup::filterLookupPreRun_3DS(callerControl,
                                                          selectedControl,
                                                          RORVenueTableActive_ds,
                                                          RORVenueTableAll_ds,
                                                          RORVenueTableBusinessRelation_ds);

    super();

    // Generate view combobox based on tabs
    tab2ComboBoxItemMap = SysLookup::tab2ComboBox(Tab, switchView);

    SysTableLookup::filterLookupPostRun(filterLookup,
                                        callerControl.text(),
                                        selectedControl,
                                        selectedFormDataSource);
}

public void setSelectMode()
{
    void setSelectedControlAndDataSource(FormStringControl _selectedControl, FormDataSource _selectedFormDataSource)
    {
        selectedControl         = _selectedControl;
        selectedFormDataSource  = _selectedFormDataSource;
    }

    switch (switchView.Selection())
    {
        case #Active  :
            this.selectMode(Active_VenueCode);
            Active_VenueCode.setFocus();
            setSelectedControlAndDataSource(Active_VenueCode, RORVenueTableActive_ds);
            break;

        case #All  :
            this.selectMode(All_VenueCode);
            All_VenueCode.setFocus();
            setSelectedControlAndDataSource(All_VenueCode, RORVenueTableAll_ds);
            break;

        case #BusRel  :
            this.selectMode(BusinessRelation_VenueCode);
            BusinessRelation_VenueCode.setFocus();
            setSelectedControlAndDataSource(BusinessRelation_VenueCode, RORVenueTableBusinessRelation_ds);
            break;
    }
}

public void init()
{
    QueryBuildDataSource    qbdsSalesTable;
    QueryBuildDataSource    qbdsSalesLine;
    QueryBuildDataSource    qbdsInventTransOriginSalesLine;
    QueryBuildDataSource    qbdsRentalTrans;
    QueryBuildDataSource    qbdsRentalType;
    str                     dateTime;

    super();

    qbdsVenueTableActive = this.query().dataSourceTable(tableNum(RORVenueTable));
    qbdsVenueTableActive.clearDynalinks();
    qbdsVenueTableActive.addRange(fieldNum(RORVenueTable, StartDate)).value(SysQuery::range(dateNull(), DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone())));
    qbdsVenueTableActive.addRange(fieldNum(RORVenueTable, EndDate  )).value(SysQuery::range(DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone()), dateMax()));
    qbdsVenueTableActive.addRange(fieldNum(RORVenueTable, EndDate  )).value(SysQuery::value(dateNull()));

    if (returnNoteTableForm)
    {
        dateTime = DateTimeUtil::toStr(DateTimeUtil::applyTimeZoneOffset(returnNoteTableForm.parmReturnDateTime(), DateTimeUtil::getUserPreferredTimeZone()));

        qbdsSalesTable = qbdsVenueTableActive.addDataSource(tableNum(SalesTable));
        qbdsSalesTable.relations(true);
        qbdsSalesTable.joinMode(JoinMode::ExistsJoin);
        qbdsSalesTable.addRange(fieldNum(SalesTable, CustAccount)).value(returnNoteTableForm.parmCustAccount());

        qbdsSalesLine = qbdsSalesTable.addDataSource(tableNum(SalesLine));
        qbdsSalesLine.relations(true);

        qbdsInventTransOriginSalesLine = qbdsSalesLine.addDataSource(tableNum(InventTransOriginSalesLine));
        qbdsInventTransOriginSalesLine.relations(true);

        qbdsRentalTrans = qbdsInventTransOriginSalesLine.addDataSource(tableNum(BOBRentalTrans));
        qbdsRentalTrans.addLink(fieldNum(InventTransOriginSalesLine, InventTransOrigin), fieldNum(BOBRentalTrans, InventTransOrigin));
        qbdsRentalTrans.addRange(fieldNum(BOBRentalTrans, SubStatus)).value(strFmt('((%1.%2 >= %3) && (%1.%2 < %4) && (%1.%5 <= %6) && (%1.%7 >= %8))',
                                                                            qbdsRentalTrans.name(),
                                                                            fieldStr(BOBRentalTrans, SubStatus),
                                                                            enum2int(BOBRentalSubStatus::Delivered),
                                                                            enum2int(BOBRentalSubStatus::Returned),
                                                                            fieldStr(BOBRentalTrans, FromDateTime),
                                                                            dateTime,
                                                                            fieldStr(BOBRentalTrans, ToDateTime),
                                                                            dateTime));

        qbdsRentalType = qbdsRentalTrans.addDataSource(tableNum(BOBRentalType));
        qbdsRentalType.relations(false);
        qbdsRentalType.joinMode(JoinMode::NoExistsJoin);
        qbdsRentalType.addRange(fieldNum(BOBRentalType, RecId)).value(strFmt("(%1 == %2.%3)",
                                                                        fieldStr(BOBRentalType, RentalTypeId),
                                                                        qbdsSalesLine.name(),
                                                                        fieldStr(SalesLine, BOBRentalTypeIdRequested)));
        qbdsRentalType.addRange(fieldNum(BOBRentalType, Classification)).value(SysQuery::value(BOBRentalTypeClassification::Serialized));
    }
}

public void init()
{
    super();

    qbdsVenueTableBusinessRelation = this.query().dataSourceTable(tableNum(RORVenueTable));

    qbdsVenueTableBusinessRelation.clearDynalinks();

